import {Link, Route} from 'react-router-dom'
import UserAvatar from '../../Notification/avitar/avitar-dropdown/avitar_dropdownhtml'
import AvitarIcon from '../../../';


class LightVersion extends Component {

    render() {
        return (
            <div className="sidebar">
                <div className="sidebar-head">
                <UserAvatar title="Benjamin Parker"  avitar={AvitarIcon}  hasDropdown haslg> <img className="" src={AvitarIcon} /></UserAvatar> 
                </div>
                <ul>

                </ul>
            </div>
        );
    }
}

export default LightVersion;
